import React from "react";
import { GCULogoLong } from "./GCULogoLong";
import { GCU_COLOR, PURPLE_GRADIENT } from "./theme";

const SPACING = "12px";

const GCUStudentIdCardHeader = () => {
  return (
    <div
      style={{
        background: PURPLE_GRADIENT,
      }}
    >
      <div
        style={{
          margin: "auto",
          padding: SPACING,
          width: "66.66%",
        }}
      >
        <GCULogoLong />
      </div>
    </div>
  );
};

export const GCUStudentIdCard = () => {
  return (
    <div
      style={{
        background: GCU_COLOR.white,
        height: "100vh",
        padding: SPACING,
      }}
    >
      <div>
        <GCUStudentIdCardHeader />
        <div style={{ padding: `calc(${SPACING} * 2)` }}></div>
        <div
          style={{
            background: PURPLE_GRADIENT,
          }}
        >
          <div
            style={{
              textAlign: "center",
            }}
          >
            <p
              style={{
                fontSize: `1em`,
                color: "rgba(255, 255, 255, 0.5)",
                fontStyle: "italic",
                marginBottom: 0,
              }}
            >
              Last Updated:
            </p>
            <p style={{ fontSize: `1em` }}>October 6, 2021, 1:38pm</p>
          </div>
        </div>
      </div>
    </div>
  );
};
